import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectVariants() {
  const [codSituacao, setSituacao] = React.useState('');
  const [status, setStatus] = React.useState('');

  const handleChange = (event) => {
    setSituacao(event.console.log.value);
    setStatus(event.target.value);
  };

  return (
    <div>
      <FormControl variant="outlined" sx={{ m: 1, minWidth: 150 }}>
        <InputLabel id="demo-simple-select-standard-label">Cód. Situação</InputLabel>
        <Select
          labelId="demo-simple-select-standard-label"
          id="demo-simple-select-standard"
          value={codSituacao}
          onChange={handleChange}
          label="codSituacao"
        >
          <MenuItem value={10}>Ativo</MenuItem>
          <MenuItem value={20}>Inativo</MenuItem>
          
        </Select>
      </FormControl>
      <FormControl variant="outlined" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-filled-label">Status</InputLabel>
        <Select
          labelId="demo-simple-select-filled-label"
          id="demo-simple-select-filled"
          value={status}
          onChange={handleChange}
        >
          <MenuItem value={10}>Ativo</MenuItem>
          <MenuItem value={20}>Inativo</MenuItem>
        </Select>
      </FormControl>
    </div>
  );
}
